import Footer from "../components/footer/Footer";
import Features from "../components/landingpage/Features";
import Hero from "../components/landingpage/Hero";

const Landing = () => {

  return (
    <div>
      <Hero />
      <Features />
    </div>
  );
};

export default Landing;
